import React from 'react';
import './search.component.scss';

export default function SearchComponent() {
  return (
    <>
    <div className='search'>
      <span>Search</span>
      <div>
        <div className='form-group'>
          <div className='flex'>
            div
          <label>
            <input className="form-control" aria-label="Default" aria-describedby="inputGroup-sizing-sm"  name='from'  /> <p />
            <input className="form-control" aria-label="Default" aria-describedby="inputGroup-sizing-sm"  name='to'  /> <p />
          </label>
          </div>
        </div>
      </div>
      </div>
    </>
  );
}
